import React from "react";
import styled from "styled-components";

const IPhone = () => {

    const [time, setTime] = React.useState(new Date());

    React.useEffect(() => {
        setInterval(() => {
            setTime(new Date());
        }, 1000);
    }, []);

    return (
        <ContactsContainer>
            <Iphone>
                <StatusBar>
                    <LeftSide className="primaryButtonText">{time.getHours()}:{time.getMinutes()}</LeftSide>
                    <RightSide>
                        <img src="/iPhoneImage/mobile-signal.svg" alt="mobile-signal"></img>
                        <img src="/iPhoneImage/Wifi.svg" alt="wi-fi"></img>
                        <img src="/iPhoneImage/Battery.svg" alt="battery"></img>
                    </RightSide>
                </StatusBar>
                <IosTabBar>

                </IosTabBar>
            </Iphone>
        </ContactsContainer>
    )
}

const ContactsContainer = styled.div`
    width: 70%;
    height: 100vh;
    margin: 90px auto;
    align-items: center;
    display: flexbox;
`

const Iphone = styled.div`
    font-family: 'SFProText';
    width: 437px;
    height: 882px;
    margin: 0px auto;
    background-image: url(/iPhoneImage/iPhoneImage.svg);
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
`

const StatusBar = styled.div`
    width: 85%;
    height: 47px;
    margin: 1.2em auto;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
`

const LeftSide = styled.span`
    width: 54px;
    height: 21px;
    padding-left: 1.5em;
`

const RightSide = styled.span`
    width: 78px;
    display: flex;
    padding-right: 1em;
    flex-direction: row;
    align-items: center;
    justify-content:  space-between;
`

const IosTabBar = styled.div`
`

export default IPhone;
